		/**
		 * Open links in new window
		 *
		 */
		newWindowLink: function () {
			$('a[href^="mailto:"]').addClass('mailto');
			$('a[href^="mailto:"], #wpadminbar a, .no-swup a, .download').attr('data-no-swup','true');

			$('a[href]').each(function() {

				if(!$(this).hasClass('mailto')) {
					if(!$(this).hasClass('samewindow'))
					{
						var a = new RegExp('/' + window.location.host + '/');
						var http = new RegExp('http');
						if(!a.test(this.href)) {
							if(http.test(this.href)) {
								$(this).click(function(event) {
									event.preventDefault();
									event.stopPropagation();
									window.open(this.href, '_blank');
								});
								$(this).attr('data-no-swup','true');
							}
						}
						else {
							var $link = $(this);
							var hash = new RegExp('^#');
							if(hash.test(this.href)) {
								$(this).addClass('scrollTo');
							}
						}
					}
				}
			});
		},

